import axios from "axios";
import { API_KEY } from "keysConfig.js";
import React, { useState } from "react";

export default {
  async getData(lat,long) {
    let res;
    try {
     res = await axios.get(
          `https://api.darksky.net/forecast/${API_KEY}/${lat},${long}`
        );
      return res;
    } catch (error) {
      return error;
    }
  },
};
